  false,\n\t\"url\": null,\n\t\"notes\": \"The geographic information system (GIS)
  format spatial data set of vegetation for Glacier National Park (GNP) was created
  by the U.S. Geological Survey (USGS)-National Park Service (NPS) Vegetation Mapping
  Program (VMP) for the Waterton-Glacier International Peace Park (WGIPP). The WGIPP
  covers an area of approximately 458,556 ha (1,133,116 acres), and includes approximately
  30.5 km (19 miles) of the Canada-United States International Boundary. The United
  States portion of this park (GNP) is located in northwestern Montana, in the Rocky
  Mountains. The map classification scheme used to create the vegetation data set
  is designed to represent local plant communities at the finest level possible using
  the National Vegetation Classification Scheme. Physiognomic information was also
  recorded, including tree height, canopy density, and coverage patterns. The vegetation
  data set was developed by interpreting aerial photographs collected in 1999, supplemented
  with aerial photography collected in 1997-98 and extensive field surveys. Individuals
  who cooperated in this project include; USGS Center for Biological Informatics,
  USGS Upper Midwest Environmental Sciences Center, NPS Glacier National Park, Parks
  Canada Waterton Lakes National Park, NatureServe, and the Montana Natural Heritage
  Program. The vegetation data are distributed as a geographic information system
  (GIS) shapefile data set, using Universal Transverse Mercator zone 12 mapping coordinates,
  North American Datum 1983.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
